import React, { Component } from 'react';
import './App.css';
import ImovelMaps from './ImovelMaps';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
            <h1>Mapa dos Imoveis</h1>
        </header>
        {
          this.state.imoveis ? 
          <div id="imoveis-map">
              <ImovelMaps />
          </div>
          : null
        }
      </div>
    );
  }
}

export default App;
